from pprint import pprint


def print_nested(dictionary, indent=0):
    """Prints nested dictionaries and lists with proper indentation."""
    for key, value in dictionary.items():
        if isinstance(value, dict):
            print('    ' * indent + str(key) + ':')
            print_nested(value, indent + 1)  # Recursively print nested dictionaries
        elif isinstance(value, list):
            print('    ' * indent + str(key) + ': [')
            for item in value:
                if isinstance(item, dict):
                    print('    ' * (indent + 1) + '{')
                    print_nested(item, indent + 2)  # Recursively print nested dictionaries in lists
                    print('    ' * (indent + 1) + '}')
                else:
                    print('    ' * (indent + 1) + str(item))
            print('    ' * indent + ']')
        else:
            print('    ' * indent + f"{key}: {value}")

# Call the function with your dictionary
